local normalObjects = {}

local failed = {} 
local failedMaterials = {}

local sampID = 0 

function createMSObject(...)
	local model = select(1, ...)
	local x,y,z,rx,ry,rz = select(2, ...), select(3, ...), select (4, ...), select(5, ...) or 0, select(6, ...) or 0, select(7, ...) or 0
	if (#normalObjects+#failed) > 5000 and y < -3500 then 
		y = y+3500
	end 
	
	local object = createObject(model, x, y, z, rx, ry, rz, false)
	local dim, int = select(8, ...) or 0 , select(9, ...) or 0 
	if not object then 
		--outputServerLog("Dodano ID "..tostring(model).." do strumieniowania")
		-- model, x, y, z, rx, ry, rz, dimension, interior	
		sampID = sampID+1
		table.insert(failed, {sampID,model,x,y,z,rx,ry,rz,dim,int})
		return sampID
	else 
		sampID = sampID+1
		setElementDimension(object, dim)
		setElementInterior(object, int)
		
		normalObjects[object] = sampID 
		
		return object, sampID
	end
end 

function destroyMSObject(object)
	if isElement(object) then 
		destroyElement(object)
		return true
	elseif type(object) == "number" then 
		for k,v in ipairs(failed) do 
			if v[1] == object then 
				table.remove(failed, k)
			end
		end 
		
		return true
	end
	
	return false
end 

function setObjectMaterial(sampObject, textureToReplace, textureName, textureColor)	
	failedMaterials[sampObject] = {material=textureName, replaceTexture=textureToReplace, textureColor=(textureColor or {255, 255, 255, 255})}
end 

-- wysÅ‚anie clientowi informacji czego brakuje
function loadMSObjects() 
	if isElement(source) then 
		triggerClientEvent(source, "onClientLoadSAMPObjects", source, failed, failedMaterials)
	end
end 
addEvent("onPlayerRequestSAMPObjects", true)
addEventHandler("onPlayerRequestSAMPObjects", root, loadMSObjects)

